      const arr8 = [8, 1, 4, 8, 4, 1];

      inPlaceQuickSort(arr1);
      inPlaceQuickSort(arr2);
      inPlaceQuickSort(arr3);
      inPlaceQuickSort(arr4);
      inPlaceQuickSort(arr5);
      inPlaceQuickSort(arr6);
      inPlaceQuickSort(arr7);
      inPlaceQuickSort(arr8);

